// @ts-ignore
const routes = require("next-routes");

module.exports = routes()
    .add({name: 'index', pattern: '/', page: 'index'})
    .add({name: 'stock', pattern: '/stock', page: 'stock'})
    .add({name: 'pricing', pattern: '/pricing', page: 'index'})
    .add({name: 'contacts', pattern: '/contacts', page: 'contacts'})
    .add({name: 'management', pattern: '/management', page: 'management'})
    .add({name: 'login', pattern: '/login', page: 'login'});
